import React from "react";
import Dropdown from './Dropdown/Dropdown'
import './menu.css'
import Fresh from './sub-content/Fresh'

function Menu() {
	return (
		<body>	
			<div className="fixedNav"><Dropdown/></div>
			<div className="fnBar"></div>
			<Fresh></Fresh>
		</body>
	);
}
export default Menu;
